import React, { useState } from "react";

function Dashboard({ peopleData, setPage, setCurrentPatient }) {
  const [search, setSearch] = useState("");

  const suspectedPeople = peopleData.filter(
    person =>
      person.candidate === "suspected" &&
      person.name.toLowerCase().includes(search.toLowerCase())
  );

  const checkedPeople = peopleData.filter(person =>
    ["confirmed", "false"].includes(person.candidate)
  );

  return (
    <div className="min-h-screen bg-blue-50 p-8 flex-1">
      <div className="flex items-center justify-between mb-6 w-full">
        <h1 className="text-3xl text-left">Hello Admin User 👋🏼,</h1>

        <div className="relative w-64">
          <input
            type="text"
            placeholder="Search people..."
            className="w-full pl-10 pr-4 py-2 rounded-xl bg-white text-black placeholder-gray-400 focus:outline-none focus:ring-2 focus:ring-blue-400 shadow-md"
            value={search}
            onChange={e => setSearch(e.target.value)}
          />
          <svg
            className="absolute left-3 top-1/2 transform -translate-y-1/2 w-5 h-5 text-black"
            xmlns="http://www.w3.org/2000/svg"
            fill="none"
            viewBox="0 0 24 24"
            stroke="currentColor"
          >
            <path
              strokeLinecap="round"
              strokeLinejoin="round"
              strokeWidth={2}
              d="M21 21l-4.35-4.35m0 0A7.5 7.5 0 104.5 4.5a7.5 7.5 0 0012.15 12.15z"
            />
          </svg>
        </div>
      </div>

      {/* Suspected */}
      <div className="mx-auto bg-white p-6 rounded-2xl shadow mb-8">
        <h1 className="text-xl font-bold mb-1 text-left">All Detected Scans</h1>
        <h2 className="text-xs mb-2 text-left text-red-900">Immediate Action Required</h2>
        <ul>
          {suspectedPeople.length > 0 ? (
            suspectedPeople.map(person => (
              <li
                key={person.id}
                className="p-2 border-b border-gray-200 text-gray-800 hover:bg-blue-50 cursor-pointer transition-colors flex-row"
                onClick={() => {
                  setPage("mri");
                  setCurrentPatient(person);
                }}
              >
                {person.name}
              </li>
            ))
          ) : (
            <li className="text-gray-500">No suspected cases found.</li>
          )}
        </ul>
      </div>

      {/* Confirmed / False */}
      <div className="mx-auto bg-white p-6 rounded-2xl shadow">
        <h1 className="text-xl font-bold mb-1 text-left">Checked Scans</h1>
        <h2 className="text-xs mb-2 text-left text-green-900">Active Patients</h2>
        <ul>
          {checkedPeople.length > 0 ? (
            checkedPeople.map(person => (
              <li
                key={person.id}
                className={`p-2 border-b border-gray-200 text-gray-800 hover:bg-blue-50 cursor-pointer transition-colors flex-row ${
                  person.candidate === "confirmed" ? "text-green-700 font-semibold" : "text-gray-600"
                }`}
              >
                {person.name}
              </li>
            ))
          ) : (
            <li className="text-gray-500">No confirmed or false cases found.</li>
          )}
        </ul>
      </div>
    </div>
  );
}

export default Dashboard;
